import React from 'react';
import Image from './image.jpg';

const Camera = () => {
    return(
        <div  className=' center ma '>
            <div className='absolute' >
                <img 
                    id='cameraOutput' 
                    alt=''
                    src={Image}
                    width='auto'
                    height='400px'
                />
                <div>
                    <p>Place</p>
                    <p>Time</p>
                    <p>User</p>
                    <p>Date</p>

                </div>
            </div>
        </div>
    )
}

export default Camera;
